import React, {Component} from 'react';
import s from './Post.module.css';

class Post extends Component {
    render() {
        return (
            <div className={s.post}>
                <input type={`text`} placeholder={`Что у вас нового...`}/>
                <button>Отправить</button>
            </div>


        );
    }
}

export default Post
